    }

    // updateTotalPrice()

    render() {
        return (
            <div className="App">
                <SiteHeader/>
                <div className='App-body'>
                    <div style={styles.pageTitle}>{Lang.translate('CART')}</div>
                    <CartClearSection clearCart={this.clearCartItems()}/>
                    <CartList companyId='8e26b6edb2ce7416f71a82ed78e08984' />
                    <Footer/>
                    <CheckoutButton />
                </div>
            </div>
        );
    }
}const styles = {
    pageTitle: {
        fontSize: '22px',
        color: Colors.fontColor,
        textAlign: 'center',
        padding: '10px',
    }
};

export default cartPage;
